"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Priapism (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/priapism-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H29306317\">",
"      <span class=\"h1\">",
"       What is priapism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Priapism is an erection that lasts 2 to 4 hours or longer and can be very painful. It is not related to having sex or wanting to have sex. Priapism can be a very serious problem. An erection that lasts more than 4 hours can cause long-term damage to the penis. It can lead to a condition called &ldquo;erectile dysfunction&rdquo; (also called &ldquo;impotence&rdquo;), which is when you have problems getting or keeping an erection.",
"     </p>",
"     <p>",
"      There are 2 main types of priapism:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Ischemic",
"        </strong>",
"        &ndash; This type of priapism happens when blood stays trapped in the penis. It can be caused by many things, including certain medicines, blood diseases (such as sickle cell anemia), cocaine use, spider bites, and spinal cord injury.",
"        <strong>",
"        </strong>",
"        <br/>",
"        <br/>",
"        Priapism that happens again and again, also called &ldquo;stuttering&rdquo; priapism, is a type of ischemic priapism. It can happen in men or boys with sickle cell anemia. It begins with brief erections that often start during sleep and continue when the person wakes up. As time goes on, this begins to happen more often and the erection lasts longer.",
"       </li>",
"       <li>",
"        <strong>",
"         Nonischemic",
"        </strong>",
"        &ndash; This type of priapism happens when blood keeps flowing into the penis, keeping it erect, but not always fully hard. It is often due to an injury of some kind and is usually not as painful as ischemic priapism.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29306339\">",
"      <span class=\"h1\">",
"       What are the symptoms of priapism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms depend on the kind of priapism. The symptoms of ischemic priapism are a very hard erection that is often painful. Nonischemic priapism is less painful and the erection is often not as hard.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29306354\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes! See your doctor or nurse right away if you have any erection that lasts longer than 2 to 4 hours. This can be a serious medical emergency.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29306369\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Your doctor or nurse can tell if you have priapism by learning about your symptoms and doing an exam. But he or she might need to do tests to find out which kind of priapism you have. These tests include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood gas analysis &ndash; In this test, the doctor takes a sample of blood from your penis and checks the blood to see how much oxygen is in it. The blood looks black if it has little or no oxygen in it. This occurs with ischemic priapism. The blood looks red in nonischemic priapism.",
"       </li>",
"       <li>",
"        Doppler ultrasound &ndash; In this test the doctor uses sound waves to look at how the blood is moving in your penis. If the blood is flowing slowly or not at all, it is probably an ischemic priapism. If the blood is flowing normally, it is most likely a nonischemic priapism.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29306384\">",
"      <span class=\"h1\">",
"       How is priapism treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment depends on the type of priapism you have.",
"     </p>",
"     <p>",
"      If you have ischemic priapism and your erection has lasted longer than 4 hours, your doctor will probably use a needle to drain some of the blood from your penis. Then he or she will inject a medicine into your penis that will make the erection go down. The doctor might need to repeat the injection until the erection is fully gone.",
"     </p>",
"     <p>",
"      Your doctor will also treat the pain from your ischemic priapism. If you have severe pain, he or she can prescribe a strong pain medicine.",
"     </p>",
"     <p>",
"      If these treatments do not work, your doctor might recommend surgery. There are different types of surgery available. Your doctor will talk to you about which is best for you.",
"     </p>",
"     <p>",
"      Nonischemic priapism often goes away on its own without treatment, even though it might last hours or days. If you have a nonischemic priapism that does not go away, your doctor might do a procedure called &ldquo;arterial embolization.&rdquo; During this procedure, the doctor inserts a thin tube into an artery in the leg and threads it up to the penis. Then he or she uses tiny pieces of foam or metal coils to close off the point where there is bleeding in the penis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29306399\">",
"      <span class=\"h1\">",
"       Can priapism be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Priapism caused by sickle cell anemia can sometimes be prevented. If you have sickle cell anemia, your doctor will work with you to find the best treatment for your situation.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29306416\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?0/24/386?source=see_link\">",
"       Patient information: Sex problems in men (The Basics)",
"      </a>",
"      <br/>",
