"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?30/11/30905?source=related_link\">",
"      Management of an adnexal mass",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?5/37/5721?source=related_link\">",
"      Ovarian germ cell neoplasms: Pathology, clinical manifestations, and diagnosis",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?16/17/16660?source=related_link\">",
"      Pathogenesis of ovarian hyperstimulation syndrome",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?35/61/36824?source=related_link\">",
"      Ultrasound examination in obstetrics and gynecology",
"     </a>",
"    </li>",
