var title_f33_40_34442="Chronic rejection Light I";
var content_f33_40_34442=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F72574%7ENEPH%2F52555%7ENEPH%2F65391&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F72574%7ENEPH%2F52555%7ENEPH%2F65391&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Light micrograph showing chronic renal transplant rejection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of an intermediate stage of chronic vascular rejection in an interlobular artery. The arterial lumen is narrowed by marked subintimal thickening with loose connective tissue (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Light micrograph showing chronic vascular renal transplant rejection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph shows end-stage chronic vascular rejection in an arcuate artery. The vascular lumen is virtually obliterated by the marked subintimal accumulation of connective tissue (arrow), a response that represents the healed phase of previous inflammatory injury.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Light micrograph showing late stage chronic renal transplant rejection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power light micrograph in chronic rejection reveals marked tubular dropout and interstitial fibrosis (in the area between the glomeruli). These findings represent the end-stage of a process induced by ischemia from the associated vascular lesions and repeated episodes of interstitial inflammation (acute cellular rejection).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
