var title_f33_40_34443="Treatment Graves";
var content_f33_40_34443=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F67833&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F67833&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment of Graves' hyperthyroidism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thionamides",
"       </td>",
"       <td>",
"        <p>",
"         Chance of permanent remission",
"        </p>",
"        <p>",
"         Some patients avoid permanent hypothyroidism",
"        </p>",
"        <p>",
"         Lower cost",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Minor side effects: rash, hives, arthralgias, transient granulocytopenia, gastrointestinal symptoms",
"        </p>",
"        <p>",
"         Major side effects: agranulocytosis, vasculitis (lupus-like syndrome), hepatitis",
"        </p>",
"        <p>",
"         Risk of fetal goiter and hypothyroidism if pregnant",
"        </p>",
"        <p>",
"         Requires more frequent monitoring",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radioiodine",
"       </td>",
"       <td>",
"        Permanent resolution of hyperthyroidism",
"       </td>",
"       <td>",
"        <p>",
"         Permanent hypothyroidism",
"        </p>",
"        <p>",
"         Patient must take radiation precautions for several days after treatment, avoiding contact with young children and pregnant women",
"        </p>",
"        <p>",
"         Rare radiation thyroiditis",
"        </p>",
"        <p>",
"         Patient concerns about long-term oncogenic effects of radiation",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Surgery",
"       </td>",
"       <td>",
"        Rapid, permanent cure of hyperthyroidism",
"       </td>",
"       <td>",
"        <p>",
"         Permanent hypothyroidism",
"        </p>",
"        <p>",
"         Risk of hypoparathyroidism, recurrent laryngeal nerve damage, and general anesthesia",
"        </p>",
"        <p>",
"         High cost",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Summary of the advantages and disadvantages of the three major therapeutic modalities used in the treatment of Graves' hyperthyroidism.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
