var title_f33_40_34444="Electrodiagnostic criteria CIDP";
var content_f33_40_34444=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F71475&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F71475&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Electrodiagnostic criteria for CIDP",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        These criteria are applied by testing the median, ulnar (stimulated below the elbow), peroneal (stimulated below the fibular head), and tibial nerves on one side of the body. During testing, limb temperature should be no less than 33&deg;C at the palm and no less than 30&deg;C at the external malleolus.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Definite CIDP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At least one of the following demyelinating parameters are necessary:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;50 percent prolongation of motor distal latency above the ULN in two nerves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;30 percent reduction of motor conduction velocity below the LLN in two nerves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;20 percent prolongation of F-wave latency above the ULN in two nerves, or &gt;50 percent if the amplitude of the distal negative peak CMAP is &lt;80 percent of the LLN",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Absence of F-waves in two nerves, if these nerves have amplitudes of distal negative peak CMAPs &ge;20 percent of the LLN, plus at least one other demyelinating parameter (meeting any of the definite criteria) in at least one other nerve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Partial motor conduction block, defined by a &ge;50 percent amplitude reduction of the proximal negative peak CMAP relative to distal, if distal negative peak CMAP is &ge;20 percent of the LLN, in two nerves, or in one nerve plus at least one other demyelinating parameter (meeting any of the definite criteria) in at least one other nerve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Abnormal temporal dispersion, defined by a &gt;30 percent duration increase between the proximal and distal negative peak CMAP in at least two nerves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Distal CMAP duration (interval between onset of the first negative peak and return to baseline of the last negative peak) increase in at least one nerve (median &ge;6.6 ms, ulnar &ge;6.7 ms, peroneal &ge;7.6 ms, tibial &ge;8.8 ms) plus at least one other demyelinating parameter (meeting any of the definite criteria) in at least one other nerve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Probable CIDP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &ge;30 percent amplitude reduction of the proximal negative peak CMAP relative to the distal, excluding the posterior tibial nerve, if the distal negative peak CMAP is &ge;20 percent of LLN, in two nerves, or in one nerve plus at least one other demyelinating parameter (meeting any of the definite criteria) in at least one other nerve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Possible CIDP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        As in \"Definite CIDP\" but in only one nerve",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CMAP: compound muscle action potential; ULN: upper limit of normal; LLN: lower limit of normal.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Joint Task Force of the EFNS and the PNS. European Federation of Neurological Societies/Peripheral Nerve Society Guideline on management of chronic inflammatory demyelinating polyradiculoneuropathy: report of a joint task force of the European Federation of Neurological Societies and the Peripheral Nerve Society--First Revision. J Peripher Nerv Syst 2010; 15:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
